import React from 'react';

import Button from '@material-ui/core/Button';
import DeleteIcon from '@material-ui/icons/Delete';






const Keep = (props) => {

    const deleteing = ()=>{
        alert("Warning ")
    }

    return (
        <>
            <div id="noteDiv">
                <h3>{props.title}</h3>
                <br />
                <p id="note">
                    {props.content}
                </p>
                <Button id="delbtn" onClick = {deleteing} >
                    <DeleteIcon id="del" />
                </Button>
            </div>
        </>
    )
}




export default Keep;
